/* eslint-disable jsx-a11y/img-redundant-alt */
// SearchPage.js

import React from "react";
import { Link, useRouteMatch, Switch, Route, useParams } from "react-router-dom";
import Search from "../components/Search";
import { useStateValue } from "../StateProvider";
import useGoogleSearch from "../useGoogleSearch";
import "./SearchPage.css";
import SearchIcon from "@material-ui/icons/Search";

function SearchPage() {
  const [{ term }, dispatch] = useStateValue();

  // The `path` lets us build <Route> paths that are
  // relative to the parent route, while the `url` lets
  // us build relative links.
  const { path, url } = useRouteMatch();

  // LIVE API
  const { data } = useGoogleSearch(term);

  console.log(data);
  return (
    <div className="searchPage">
      {/* Header */}
      <div className="searchPage_header">
        <Link to="/">
          <img
            src="https://cdn.discordapp.com/attachments/1123095896989642854/1136196482597392499/Screenshot_9.png"
            className="searchPage_logo"
            alt="google logo"
          />
        </Link>
        <div className="searchPage_headerBody">
          <Search hideButtons />
        </div>
      </div>
      {/* Routing header options */}

          {/* Results */}
          {term ? (
            <div className="searchPage_results">
              <p className="searchPage_resultsCount">
                About {data?.searchInformation.formattedTotalResults} results (
                {data?.searchInformation.searchTime} seconds) for {term}
              </p>

              {/* Divide the search results into two rows (left and right) */}
              <div className="searchPage_resultsContainer">
                <div className="searchPage_resultsColumn">
                  {data?.items.slice(0, 4).map((item) => (
                    <div className="searchPage_result" key={item.link}>
                      <a href={item.link} className="searchPage_resultLink">
                        {/* Show image if it is there */}
                        {item.pagemap?.cse_image?.length > 0 &&
                          item.pagemap?.cse_image[0].src && (
                            <img
                              src={item.pagemap?.cse_image[0].src}
                              alt="result image"
                              className="searchPage_resultImage"
                            />
                          )}
                        {item.displayLink}
                      </a>
                      <a href={item.link} className="searchPage_resultTitle">
                        <h3>{item.title}</h3>
                      </a>
                      <p className="searchPage_resultSnippet">{item.snippet}</p>
                    </div>
                  ))}
                </div>
                <div className="searchPage_resultsColumn">
                  {/* Display News */}
                  <div className="searchPage_news">
                    {/* You can use an API to fetch the latest news and display it here */}
                    {/* Sample content below */}
                    <h3>Latest News</h3>
                    <ul>
                      <li>News Item 1</li>
                      <li>News Item 2</li>
                      <li>News Item 3</li>
                    </ul>
                  </div>

                  {/* Display Images */}
                  <div className="searchPage_images">
                    {/* You can use an API to fetch the latest images and display them here */}
                    {/* Sample content below */}
                    <h3>Latest Images</h3>
                    <ul>
                      <li>Image 1</li>
                      <li>Image 2</li>
                      <li>Image 3</li>
                    </ul>
                  </div>

                  {/* Display Videos */}
                  <div className="searchPage_videos">
                    {/* You can use an API to fetch the latest videos and display them here */}
                    {/* Sample content below */}
                    <h3>Latest Videos</h3>
                    <ul>
                      <li>Video 1</li>
                      <li>Video 2</li>
                      <li>Video 3</li>
                    </ul>
                  </div>
                </div>
              </div>
            </div>
          ) : (
            <div className="searchPage_results emptyMessage">
              Please type something in the search box to search something.
            </div>
          )}

    </div>
  );
}

export default SearchPage;

function Option() {
  let { optionId } = useParams();

  return (
    <div>
      <h3>{optionId}</h3>
    </div>
  );
}
